import React from 'react';
import { Text } from 'react-native';
import { AntDesign } from '@expo/vector-icons';

import { RestauranteView, RestauranteFoto, RestauranteInfo } from './style'

const RestauranteItem = ({ foto, nome, key, nota, categoria, distancia, valorEntrega, tempoEntrega }) => {
  return (
      <RestauranteView key={key}>
        <RestauranteFoto 
          source={{
            uri: foto.trim(),
            width: 50,
            height: 50,
            resizeMode: 'cover'
          }}
        />
        <RestauranteInfo>
          <Text>{nome}</Text>
          <Text><AntDesign name='star' size={12} color="#F9A825" />{nota} - {categoria} - {distancia}</Text>
          <Text>{tempoEntrega} + R$ {valorEntrega} </Text>
          <Text></Text>
        </RestauranteInfo>
      </RestauranteView>
  );
}

export default RestauranteItem;
